import React, { Component } from "react";
import Feeds from "../components/Feeds";
import axios from "axios";
import { Redirect } from "react-router-dom";

class FeedsContainer extends Component{

    constructor(props){
        super(props);

        this.state = {
            data:{},
            flag: false
        };
    }

    componentDidMount(){
        axios.get('http://localhost:8080/post/'+ sessionStorage.get)
    }

    onChangeHandler = (event) => {
        let data = this.state.data;
        data[event.target.name] = event.target.value;
        this.setState({data});
        console.log(data);
    }

    render(){
        const {data, flag} = this.state;
        return (
           <Feeds data ={data} onSubmitHandler = {this.onSubmitHandler} onChangeHandler = {this.onChangeHandler}/>
        );
    }
}

export default FeedsContainer;
